import { useEffect, useState } from "react";
import NavbarComponent from "../components/Navbar";
import SidebarComponent from "../components/Sidebar";


const UsersPage = () => {
    c
    // states
    const [refresh, setRefresh] = useState(false)
    // const [search, setSearch] = useState("")
    const [users, setUsers] = useState()

    // use effect
    useEffect(() => {
        console.log('Refreshed');
    }, [refresh]);

    // status change
    const changeStatus = (index, status) => {
        users[index].status = status
        setUsers(users)
        setRefresh(!refresh)
    }

    // search
    const search = (value) => {
        console.log(value,"===value===");
        if (value) {
            const lowercase_value = value.toLowerCase();
            const filterd_users = users.filter(user => user.name.toLowerCase().includes(lowercase_value) || user.mobile_no.toLowerCase().includes(lowercase_value));
            setUsers(filterd_users)
            setRefresh(!refresh)
        } else {
            window.location.reload()
        }
    }

    // return
    return (
        <>
            <NavbarComponent now={'users'} />
            <SidebarComponent now={'users'} />
            <div className="w-auto min-h-screen px-3 pt-16 md:ml-60 lg:ml-80">
                <div className="w-full min-h-screen bg-gray-200 rounded-lg px-5 py-5 mt-3">
                    {/* Search Bar */}
                    <div className="mb-3">
                        <input
                            type="text"
                            id="search"
                            placeholder="Search..."
                            className="flex px-4 w-2/12 py-1 bg-white border rounded-full ml-auto text-xs lg:text-sm"
                            // value={search}
                            onChange={(e) => search(e.target.value)}
                        />
                    </div>
                    {/* Table */}
                    <div className="w-full bg-gray-100 overflow-x-auto">
                        <table className="w-full table-auto border-collapse border border-gray-400">
                            <thead>
                                <tr>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Name
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Mobile No
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Age
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Gender
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Status
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                {users.map((item, index) => (
                                    <tr key={index}>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.name}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.mobile_no}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.age}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.gender}
                                        </td>
                                        <td className="border text-xs border-gray-300 px-4 py-2">
                                            <div className="w-full flex justify-center">
                                                <div onClick={() => changeStatus(index, item.status === "ACTIVE" ? "INACTIVE" : "ACTIVE")} className="w-20 bg-gray-300 rounded-full shadow-md shadow-inner">
                                                    {
                                                        item.status === "ACTIVE" ?
                                                            <div className="flex w-14 py-1 bg-green-700 rounded-full text-white font-bold ml-auto justify-center status-box">
                                                                {item.status}
                                                            </div>
                                                            :
                                                            <div className="flex w-14 py-1 bg-red-600 rounded-full text-white font-bold justify-center status-box">
                                                                {item.status}
                                                            </div>
                                                    }
                                                </div>
                                            </div>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                    {/* Table */}
                </div>
            </div>
        </>
    );
}

export default UsersPage;
